import ReactDOM from 'react-dom';
import './index.css';

const BookList = () =>{
    return(
    <section className='booklist'>
        <Book />
        <Book></Book>
        <Book></Book>
    </section>
    );
    }
    const Book =()=>{
    return(
    <article className='book'>
        <Image/>
        <Title/>
        <Author/>
    </article>
    );
    }
    const Title = ()=>{
    return <h1>A Man Called Ove</h1>
    }
    const Author =()=>{
    return <h4>Fredrick Batman</h4>
    }
    const Image =()=>{
    return <img src="https://m.media-amazon.com/images/I/81DXIOk9glL._AC._SR360,460.jpg" alt='book' style={{width:'200px', height : '200px'}} />
    }



ReactDOM.render(<BookList></BookList>,document.getElementById('root'));
